%[text] # SAGE Data Retrieval
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] ## How to use this notebook
%[text] ### Data Retrieval- Time Series Data
%[text] Time series data can be retrieved in the miniSeed format via SAGE's fsdnws service. The function sageFetch.m retrieves the data directly into the MATLAB workspace without downloading the file itself. To build the appropriate URL for fetching data, fill in the fields in the next section. It is okay to leave a field blank. A table called "request\_info" will be assembled with your specified parameters.
%[text] SageFetch takes the request\_info table as an input and builds the URL for requesting your desired data. The URL building works in the same way as SAGE's own URL builder, composing a URL string from your input criteria. SageFetch then uses [MATLAB's built-in RESTful web service functions](https://www.mathworks.com/help/matlab/http-interface.html?s_tid=CRUX_lftnav) to bring the requested data directly from the internet into your workspace. However, in order to interpret the miniSEED file format, sageFetch calls the function rdmseed, created by [Fran√ßois Beauducel](https://www.mathworks.com/matlabcentral/profile/authors/1195687) and available on the MATLAB File Exchange or GitHub. If you do not have this function downloaded/installed on the MATLAB path, sageFetch will not be able to bring in the miniSEED data. 
%[text] 
%[text] Currently, miniSEED is the only available data format to work with. MATLAB has geocsv and [SAC file reading](https://www.mathworks.com/matlabcentral/fileexchange/46356-rdsac-and-mksac-read-and-write-sac-seismic-data-file) and writing capabilities. However, it is currently unclear how SAGE stores or creates data files in the non miniSEED format. (Are all files stored as miniSEED and only converted to SAC or geocsv upon request?) Once this is understood, options for accessing files in these other formats will be made possible.
%[text] 
%%
%[text] ## Select your data parameters
network = "IU"; %[control:editfield:65d4]{"position":[11,15]}
station = "ANMO"; %[control:editfield:2ffb]{"position":[11,17]}
location = ""; %[control:editfield:26a9]{"position":[12,14]}
channel = "BHZ"; %[control:editfield:3d71]{"position":[11,16]}
start_time = datetime("2025-02-05", "InputFormat", "uuuu-MM-dd"); % for now, you'll need to specify your own time if you want it down to the minute and second %[control:datePicker:150e]{"position":[14,65]}
% hours - minutes - seconds
end_time = datetime("2025-02-06", "InputFormat", "uuuu-MM-dd"); % for now, you'll need to specify your own time if you want it down to the minute and second %[control:datePicker:44ee]{"position":[12,63]}
% hours - minutes - seconds
quality = ""; %[control:dropdown:8334]{"position":[11,13]}
file_format = "miniSeed"; %[control:dropdown:8900]{"position":[15,25]}
% min_length = ""; no longer supported by SAGE %[control:editfield:7168]{"position":[16,18]}
longestOnly = false; %[control:checkbox:64d8]{"position":[15,20]}
useAuth = false; %[control:checkbox:93d8]{"position":[11,16]}

request_info = table(network, station, location, channel, start_time, ...
    end_time, quality, file_format, longestOnly, useAuth);

clear network station location channel start_time end_time quality file_format longestOnly useAuth

% working example URL: url = "https://service.iris.edu/fdsnws/dataselect/1/query?sta=ANMO&cha=BHZ&starttime=2025-02-06T00:00:00&endtime=2025-02-06T02:00:00&format=mseed&nodata=404"
%%
%[text] ## Retrieve your data
S = sageFetch(request_info);
%%
%[text] ## Create some plots
figure %[output:6b2fc4f6]
plot(S(1).d) %[output:6b2fc4f6]
ylabel('Amplitude') %[output:6b2fc4f6]
xlabel('Index') %[output:6b2fc4f6]
% Change the x-axis to the appropriate time
t =  datetime(S(1).t,'ConvertFrom','datenum','Format','yyyy-MM-dd HH:mm:ss.SSSSSS');

figure %[output:30700a42]
plot(t,S(1).d) %[output:30700a42]
ylabel('Amplitude') %[output:30700a42]
title(strcat(S(1).ChannelFullName, ', date:',S(1).RecordStartTimeISO)) %[output:30700a42]


% another plot option
figure %[output:037858bc]
h = tiledlayout(3,1); %[output:037858bc]
nexttile %[output:037858bc]
plot(S(1).d); %[output:037858bc]
nexttile %[output:037858bc]
plot(S(2).d) %[output:037858bc]
nexttile %[output:037858bc]
plot(S(3).d) %[output:037858bc]

title(h,'Multiple Plots') %[output:037858bc]

